import Header from "../Header";

const categoryPage = props => {
  return (
    <div className="content-container">
      <Header
        title="Kategorien"
        text="Herzlich Willkommen, hier sind die Kategorien, zu denen Ihre Dokumente zugewiesen werden.&amp&shy; Sie können neue Kategorien hinzufügen oder löschen."
      />


    </div>
  );
};

export default categoryPage;
